core::clone::Clone::clone.doc:
Returns a duplicate of the value.

Note that what "duplicate" means varies by type:
- For most types, this creates a deep, independent copy
- For reference types like `&T`, this creates another reference to the same value
- For smart pointers like [`Arc`] or [`Rc`], this increments the reference count
  but still points to the same underlying data

[`Arc`]: ../../std/sync/struct.Arc.html
[`Rc`]: ../../std/rc/struct.Rc.html

# Examples

```
# #![allow(noop_method_call)]
let hello = "Hello"; // &str implements Clone

assert_eq!("Hello", hello.clone());
```

Example with a reference-counted type:

```
use std::sync::{Arc, Mutex};

let data = Arc::new(Mutex::new(vec![1, 2, 3]));
let data_clone = data.clone(); // Creates another Arc pointing to the same Mutex

{
    let mut lock = data.lock().unwrap();
    lock.push(4);
}

// Changes are visible through the clone because they share the same underlying data
assert_eq!(*data_clone.lock().unwrap(), vec![1, 2, 3, 4]);
```

collections::linked_list::LinkedList::<T.doc:
Constructs an empty `LinkedList<T, A>`.

# Examples

```
#![feature(allocator_api)]

use std::alloc::System;
use std::collections::LinkedList;

let list: LinkedList<u32, _> = LinkedList::new_in(System);
```

Provides a forward iterator.

# Examples

```
use std::collections::LinkedList;

let mut list: LinkedList<u32> = LinkedList::new();

list.push_back(0);
list.push_back(1);
list.push_back(2);

let mut iter = list.iter();
assert_eq!(iter.next(), Some(&0));
assert_eq!(iter.next(), Some(&1));
assert_eq!(iter.next(), Some(&2));
assert_eq!(iter.next(), None);
```

core::iter::Iterator::cloned.doc:
Creates an iterator which [`clone`]s all of its elements.

This is useful when you have an iterator over `&T`, but you need an
iterator over `T`.

There is no guarantee whatsoever about the `clone` method actually
being called *or* optimized away. So code should not depend on
either.

[`clone`]: Clone::clone

# Examples

Basic usage:

```
let a = [1, 2, 3];

let v_cloned: Vec<_> = a.iter().cloned().collect();

// cloned is the same as .map(|&x| x), for integers
let v_map: Vec<_> = a.iter().map(|&x| x).collect();

assert_eq!(v_cloned, [1, 2, 3]);
assert_eq!(v_map, [1, 2, 3]);
```

To get the best performance, try to clone late:

```
let a = [vec![0_u8, 1, 2], vec![3, 4], vec![23]];
// don't do this:
let slower: Vec<_> = a.iter().cloned().filter(|s| s.len() == 1).collect();
assert_eq!(&[vec![23]], &slower[..]);
// instead call `cloned` late
let faster: Vec<_> = a.iter().filter(|s| s.len() == 1).cloned().collect();
assert_eq!(&[vec![23]], &faster[..]);
```

core::iter::Extend::extend.doc:
Extends a collection with the contents of an iterator.

As this is the only required method for this trait, the [trait-level] docs
contain more details.

[trait-level]: Extend

# Examples

```
// You can extend a String with some chars:
let mut message = String::from("abc");

message.extend(['d', 'e', 'f'].iter());

assert_eq!("abcdef", &message);
```

